import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App.jsx';
import PortfolioContext, { PortfolioProvider } from './PortfolioContext'

ReactDOM.render(
  <React.StrictMode>
    <PortfolioProvider>
      <App />
    </PortfolioProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
